import React from "react";
import PropTypes from "prop-types";

const ReactToPost = ({ postId, symbol, onReactToPost }) => {
  const handleReact = () => {
    onReactToPost(postId, symbol);
  };

  return (
    <button className="btn btn-link" onClick={handleReact}>
      <i className={`bi bi-${symbol}`}></i>
    </button>
  );
};

ReactToPost.propTypes = {
  postId: PropTypes.number.isRequired,
  symbol: PropTypes.string.isRequired,
  onReactToPost: PropTypes.func.isRequired,
};

export default ReactToPost;
